import React, { useState, useEffect } from "react"
import $ from "jquery"

import "./Map Page.scss"

export default function MapPage() {
    const [ img, setimg ] = useState("");

    useEffect(() => {
        $(function () {
            console.log("-------------Start-------------")
            console.log(localstorage.getItem("maps"), localstorage.getItem("curr"))
        });
    }, [0])
    
    return (
        <>
            <nav className="map-page-nav">
                <ul className="map-page-nav-list">
                    <li className="map-page-nav-list-item"></li>
                    <li className="map-page-nav-list-item"></li>
                    <li className="map-page-nav-list-item"></li>
                </ul>
            </nav>
            <img src="" alt="" className="map-page" />
        </>
    )
}
